import { Morph } from "lively.morphic";
import { pt, rect } from "lively.graphics/index.js";

export default class Flap extends Morph {  
  static get properties() {
    return {
      extruded:  { defaultValue: false },
      position:           {isStyleProp: true, defaultValue: 'fixed'},
      orientation:  {defaultValue: 'bottom'}
    }
  }

  async onLoad(){
    await this.whenRendered()
    this.Handle = this.getSubmorphNamed('Handle');    
    this.relayout();
    this.ensurePosition();
    $world.setProperty('clipMode','hidden')
  }
  relayout(evt){    
    var handleBuffer = this.Handle.height + 20;    
    var buffer = this.extruded ? this.extrusion : pt(0,0);
    console.log($world.visibleBounds())
    this.position = this.computeNewPoint(this.orientation,this).addPt(buffer)
    var {x,y} = this.computeNewPoint(this.orientation,this),
        {height,width} = $world.visibleBounds()
    console.log({x,y,width,height})
    if (this.orientation == 'top' || this.orientation == 'bottom') {
      var bounds = rect(x + buffer.x,y + buffer.y,width,500)
    } else {
      var bounds = rect(x + buffer.x,y + buffer.y,height,500)
    }    
    this.setBounds(bounds)
  }
  handleClicked(evt){
    this.extruded = !this.extruded;
    this.relayout();
  }
  testStyleChange(){
    var style = document.getElementById(this._id).getAttribute('style').replace('position: absolute','position: fixed')
var newStyle = document.getElementById(this._id).setAttribute('style',style)
  }
  setContent(aMorph) {
    var content  = this.getSubmorphNamed('content')
    content.addMorph(aMorph)
    aMorph.extent = content.extent
    var oldOrigin = aMorph.origin
    aMorph.origin = pt(0,0)
    aMorph.position = pt(0,0)
    aMorph.origin = oldOrigin    
  }

  computeNewPoint(direction,flap){
    var {height, width, x,y} = $world.visibleBounds()

    var translation = new pt

    switch(direction) { 
      case "bottom": { 
        translation.x = x
        translation.y = y  + height - flap.Handle.height
        flap.extrusion = pt(0,-(flap.height - flap.Handle.height))
        break; 
      }
      case "top": { 
        translation.x = x + width
        translation.y = y + flap.Handle.height
        flap.extrusion = pt(0,(flap.height - flap.Handle.height))
        break; 
      }
      case "left": { 
        translation.x = x + flap.Handle.height     
        translation.y = y
        flap.extrusion = pt((flap.height - flap.Handle.height),0)
        break; 
      }
      case "right": { 
        translation.x = width + x - flap.Handle.height
        translation.y = y + height
        flap.extrusion = pt(-(flap.height - flap.Handle.height),0)
        break; 
      }        
    }

    //Returns translated point
    return translation//.addPt(pt(x,y))

  }
  ensurePosition(){
    var orientation = this.orientation,
        loc = new pt,
        bounds = $world.visibleBounds(),
        flap = this;

    switch(orientation) {
      case "bottom": {
        loc.x = bounds.x;
        loc.y = bounds.y + bounds.height  - flap.Handle.height;
        flap.rotation = 0;
        break;
      }
      case "top": {
        loc.x = bounds.x + bounds.width;
        loc.y = bounds.y + flap.Handle.height;
        flap.rotation = Math.PI;
        break;
      }
      case "left": {
        loc.x = bounds.x + flap.Handle.height;
        loc.y = bounds.y;
        flap.rotation = Math.PI/2;
        break;
      }
      case "right": {
        loc.x = bounds.x + bounds.width - flap.Handle.height;
        loc.y = bounds.y + bounds.height;
        flap.rotation = 3 * Math.PI/2;        
        break;
      }        
    }
    flap.position = loc
  }
  setOrientation(direction) {
    this.extruded = false
    this.orientation = direction
    this.ensurePosition()
    this.position = this.computeNewPoint(this.orientation,this)    
  }
}

